import React from 'react';
import classes from './TotalCount.module.css'

const TotalCount = () => {
  return( 
  <div className={classes.count_wrapper}>
    <span className={classes.count}>0</span>
    <span>из 12</span>
  </div>);
};

export default TotalCount;
